import { useEffect, useState } from "react";

function App() {
  const [cards, setCards] = useState([]);
  const [formData, setFormData] = useState({
    title: "",
    imageUrl: "",
    downloadUrl: "",
    readUrl: "",
  });

  const fetchCards = () => {
    fetch("/api/cards")
      .then((res) => res.json())
      .then((data) => setCards(data));
  };

  useEffect(() => {
    fetchCards();
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    fetch("/api/cards", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData),
    })
      .then((res) => res.json())
      .then(() => {
        setFormData({
          title: "",
          imageUrl: "",
          downloadUrl: "",
          readUrl: "",
        });
        fetchCards(); // Refresh card list
      });
  };

  return (
    <div className="p-4 max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold mb-6">ðŸ“š Card Collection</h1>

      {/* Form */}
      <form onSubmit={handleSubmit} className="mb-8 space-y-4">
        <input
          type="text"
          name="title"
          placeholder="Title"
          value={formData.title}
          onChange={handleChange}
          className="w-full border p-2 rounded"
          required
        />
        <input
          type="text"
          name="imageUrl"
          placeholder="Image URL"
          value={formData.imageUrl}
          onChange={handleChange}
          className="w-full border p-2 rounded"
          required
        />
        <input
          type="text"
          name="downloadUrl"
          placeholder="Download URL"
          value={formData.downloadUrl}
          onChange={handleChange}
          className="w-full border p-2 rounded"
          required
        />
        <input
          type="text"
          name="readUrl"
          placeholder="Read URL"
          value={formData.readUrl}
          onChange={handleChange}
          className="w-full border p-2 rounded"
          required
        />
        <button
          type="submit"
          className="bg-purple-600 text-white px-4 py-2 rounded hover:bg-purple-700"
        >
          Add Card
        </button>
      </form>

      {/* Cards Display */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        {cards.map((card) => (
          <div key={card._id} className="bg-white rounded-2xl shadow-lg p-4">
            <img
              src={card.imageUrl}
              alt={card.title}
              className="rounded-xl w-full h-48 object-cover"
            />
            <h2 className="text-xl font-semibold mt-4">{card.title}</h2>
            <div className="mt-4 flex justify-between">
              <a
                href={card.downloadUrl}
                target="_blank"
                rel="noopener noreferrer"
                className="bg-blue-500 text-white px-4 py-2 rounded-xl hover:bg-blue-600"
              >
                Download
              </a>
              <a
                href={card.readUrl}
                target="_blank"
                rel="noopener noreferrer"
                className="bg-green-500 text-white px-4 py-2 rounded-xl hover:bg-green-600"
              >
                Read
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
